class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """

        if len(s) == 0:
            return 0

        l = [s[0]]
        max_so_far = 1
        current_index = 0

        i = 1

        while i in range(1, len(s)):
            if s[i] in l:
                if len(l) > max_so_far:
                    max_so_far = len(l)
                index = l.index(s[i])
                l = l[index + 1:]
                l.append(s[i])

            else:
                l.append(s[i])

            i += 1

        if len(l) > max_so_far:
            max_so_far = len(l)

        return max_so_far


